import React from "react";
import { NavLink } from "react-router-dom";

const NavItem = ({ title, path, authUser }) => {
  return (
    <NavLink
      key={title}
      id="navItems"
      authUser={authUser}
      className="nav-item nav-link"
      to={`${path}`}
    >
      {title}
    </NavLink>
  );
};

export default NavItem;
